  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed action considered in this
  assessment would implement a management program at Malheur Refuge aimed at accomplishing
  the following objectives: 1) to enhance natural plant community of the refuge ecosystem
  by ensuring that pest plant treatment activities are necessary and ecologically
  sound; 2) to enhance the capabilities of refuge lands to produce desired wildlife
  outputs at economical costs by utilizing pest plant treatment methods having the
  greatest long-term effectiveness, and 3) to comply with state and county noxious
  weed control ordinances.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
